def vowel_percentage(text):
    vowels = "aeiouAEIOU"
    num_vowels = 0
    for letter in text:
        if letter in vowels:
            num_vowels += 1
    percentage = (num_vowels/len(text)) * 100
    return percentage

print(vowel_percentage("Hello World!"))

def remove_odd_index_char(string):
    """
    Remove the characters of odd index in a given string
    """
    result = "" 
    for i in range(len(string)):
        if i % 2 == 0:
            result = result + string[i] 
    return result

